import React,{Component,Fragment} from 'react';
import ReactDOM from 'react-dom';
import HomePage from './homepage';

class Page extends Component{
    constructor(props){
        super(props)
    }
    render(){
        return(
            <Fragment>
                <button>跳转页面</button>

                <HomePage />

            </Fragment>
        )
    }
}

ReactDOM.render(<Page />, document.getElementById('root'));
